script: |
  super -f text -I q8258.spq | sort > q8258.out

inputs:
  - name: q8258.spq
    data: |
      SELECT DISTINCT - col2 * - 52 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 * - - col1 NOT IN ( + col0 / - ( 10 ), 71, + + col0, - CAST ( - - col0 AS INTEGER ) / + col2 * + CAST ( col2 AS REAL ) * + col1 + 32 );
  - name: tab1

outputs:
  - name: q8258.out
    data: |
